<div style="position: relative; left: 0; top: 0;" id="img">
    <div id="fotoAlbum" class="album-cover eye">
        <div class="vinyl-cover"></div>
        <div class="album-info texto">
            <h1>Nombre del Álbum</h1>
            <h2 id="nombreCliente">Artista</h2>
            <div class="song-list">
                <div class="column">
                    <ul class="texto">
                        <li id="cancion1"></li>
                        <li id="cancion2" class="back"></li>
                        <li id="cancion3" class="back"></li>
                        <li id="cancion4" class="back"></li>
                        <li id="cancion5" class="back"></li>
                    </ul>
                </div>
                <div class="column">
                    <ul class="texto">
                        <li id="cancion6" class="back"></li>
                        <li id="cancion7" class="back"></li>
                        <li id="cancion8" class="back"></li>
                        <li id="cancion9" class="back"></li>
